import React from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  SafeAreaView,
  StyleSheet,
  Platform,
  StatusBar,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import SafeMitraLogo from '../components/SafeMitraLogo';

const EmergencyEvidenceDataScreen = () => {
  const navigation = useNavigation();

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity
          style={styles.backButton}
          onPress={() => navigation.goBack()}>
          <Ionicons name="arrow-back" size={24} color="#FF3B30" />
        </TouchableOpacity>
        <View style={styles.logoContainer}>
          <SafeMitraLogo color="#FF3B30" size={30} />
          <Text style={styles.logoText}>SafeMitra</Text>
        </View>
      </View>

      <View style={styles.content}>
        <Text style={styles.title}>Your Emergency Evidence</Text>
        <Text style={styles.subtitle}>
          This information is securely stored and viewable only by you.
        </Text>

        <View style={styles.evidenceCard}>
          {/* Voice Recording Section */}
          <View style={styles.evidenceSection}>
            <Text style={styles.sectionLabel}>Voice Recording:</Text>
            <View style={styles.audioPlayer}>
              <TouchableOpacity style={styles.playButton}>
                <Ionicons name="play" size={24} color="#FFFFFF" />
              </TouchableOpacity>
              <Text style={styles.audioText}>Emergency Voice Recording</Text>
            </View>
          </View>

          {/* Location Section */}
          <View style={styles.evidenceSection}>
            <Text style={styles.sectionLabel}>Location:</Text>
            <View style={styles.locationContainer}>
              <Ionicons name="location" size={24} color="#FF3B30" />
              <Text style={styles.locationText}>
                123 Main Street, City, State 12345
              </Text>
            </View>
          </View>

          {/* Timestamp Section */}
          <View style={styles.evidenceSection}>
            <Text style={styles.sectionLabel}>Date & Time:</Text>
            <View style={styles.timestampContainer}>
              <Ionicons name="time" size={24} color="#FF3B30" />
              <Text style={styles.timestampText}>
                March 15, 2024 - 14:30:45
              </Text>
            </View>
          </View>
        </View>

        <TouchableOpacity style={styles.downloadButton}>
          <Ionicons name="download" size={24} color="#FFFFFF" style={styles.downloadIcon} />
          <Text style={styles.downloadButtonText}>Download Evidence</Text>
        </TouchableOpacity>

        <Text style={styles.securityNote}>
          Emergency data remains encrypted and private until downloaded.
        </Text>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFFFFF',
    paddingTop: Platform.OS === 'android' ? StatusBar.currentHeight : 0,
  },
  header: {
    flexDirection: 'row',
    alignItems: 'center',
    paddingHorizontal: 16,
    paddingVertical: 12,
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E0E0E0',
    marginTop: Platform.OS === 'ios' ? 20 : 0,
  },
  backButton: {
    marginRight: 16,
    padding: 4,
  },
  logoContainer: {
    flex: 1,
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    marginRight: 40,
  },
  logoText: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#FF3B30',
    marginLeft: 8,
  },
  content: {
    flex: 1,
    padding: 16,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#FF3B30',
    textAlign: 'center',
    marginBottom: 8,
  },
  subtitle: {
    fontSize: 16,
    color: '#666666',
    textAlign: 'center',
    marginBottom: 24,
  },
  evidenceCard: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 20,
    marginBottom: 24,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
    borderWidth: 1,
    borderColor: '#E0E0E0',
  },
  evidenceSection: {
    marginBottom: 20,
  },
  sectionLabel: {
    fontSize: 14,
    color: '#666666',
    marginBottom: 8,
  },
  audioPlayer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  playButton: {
    width: 40,
    height: 40,
    borderRadius: 20,
    backgroundColor: '#FF3B30',
    justifyContent: 'center',
    alignItems: 'center',
    marginRight: 12,
  },
  audioText: {
    fontSize: 16,
    color: '#111111',
  },
  locationContainer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  locationText: {
    fontSize: 16,
    color: '#111111',
    marginLeft: 12,
  },
  timestampContainer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  timestampText: {
    fontSize: 16,
    color: '#111111',
    marginLeft: 12,
  },
  downloadButton: {
    flexDirection: 'row',
    backgroundColor: '#FF3B30',
    borderRadius: 25,
    height: 50,
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 16,
  },
  downloadIcon: {
    marginRight: 8,
  },
  downloadButtonText: {
    color: '#FFFFFF',
    fontSize: 18,
    fontWeight: '600',
  },
  securityNote: {
    fontSize: 14,
    color: '#666666',
    textAlign: 'center',
    fontStyle: 'italic',
  },
});

export default EmergencyEvidenceDataScreen;
